I typically have a single App struct where all application state and GTK widgets that are regularly interacted with are stored. We're going to start with a struct that contains a gtk::Button and a u32 "clicked" variable. use async_channel::Sender; struct App { pub button: gtk::Button, pub clicked: u32,
} impl App { pub fn new(tx: Sender<Event>) -> Self {}
} When creating the application, we will take ownership of the Sender that we created earlier, and pass this into every connect_signal() method that is called on a widget. The connect_signal() methods will create a future on the main context that idles until the condition for that future has been emitted. A gtk::Button, for example, has a connect_clicked() method which will have its callbacks invoked when clicked is emitted — which happens on a click of the button. Note that you may connect multiple callbacks onto the same signal. If you wish to remove one, you should be careful to store the SignalHandlerId that is returned from the connect_signal() method. Then call widget.disconnect(id) to remove the signal registered to that widget. If you only wish to temporarily block a signal, you can call widget.block_signal(id) and widget.unblock_signal(id) respectively.

