First, we will create the button that we will have the user click. The button will have a label which reads, "Click Me". The border will be set to 4 so that the button isn't hugging the edges of the container it is attached to. And then will program it to send an event when it is clicked. let button = cascade! { gtk::Button::with_label("Click Me"); ..set_border_width(4); ..connect_clicked(move |_| { block_on(tx.send(Event::Clicked)); });
}; Note that since we are using an async channel, the sender has to be awaited when it is sending a value. We can use GLib's default executor to await our send. Next is creating a container widget to hold our button. This container will also invoke show_all() to make the container visible, and all of the widgets inside the container. let container = cascade! { gtk::Box::new(gtk::Orientation::Vertical, 0); ..add(&button); ..show_all();
};

