Next we we will create the Toplevel window for this application, and attach our container to the window. We will set a title, connect the event to be called when window is deleted, and also set the default icon for our application. The Toplevel window is the main window of your application. A window can only have one widget attached to it, which we will assign with the add() method. The set_title() method will set the title of your application. The connect_delete_event method is invoked whenever the window is destroyed, and we will program this to call gtk::main_quit() to stop the mainloop, thereby having gtk::main() return, which has our application quit. let _window = cascade! { gtk::Window::new(gtk::WindowType::Toplevel); ..add(&container); ..set_title("First GTK App"); ..connect_delete_event(move |_, _| { gtk::main_quit(); gtk::Inhibit(false) }); ..show_all();
}; One last thing that should be done for window managers is to set a default icon for the application: gtk::Window::set_default_icon_name("icon-name-here"); Now we can finally return our App struct, which should look like so: impl App { pub fn new(tx: Sender<Event>) -> Self { let button = cascade! { gtk::Button::with_label("Click Me"); ..set_border_width(4); ..connect_clicked(move |_| { let _ = block_on(tx.send(Event::Clicked)); }); }; let container = cascade! { gtk::Box::new(gtk::Orientation::Vertical, 0); ..add(&button); ..show_all(); }; let _window = cascade! { gtk::Window::new(gtk::WindowType::Toplevel); ..set_title("First GTK App"); ..add(&container); ..connect_delete_event(move |_, _| { gtk::main_quit(); gtk::Inhibit(false) }); ..show_all(); }; gtk::Window::set_default_icon_name("icon-name-here"); Self { button, clicked: 0 } }
}

